script: |
  super -f text -I q10979.spq | sort > q10979.out

inputs:
  - name: q10979.spq
    data: |
      SELECT DISTINCT + - col1 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + col0 - 6 * + col0 BETWEEN + + col2 AND - col0 * - 18 + - col1 + - - col0;
  - name: tab2

outputs:
  - name: q10979.out
    data: |
      -51
      -67
      -77
